import React from 'react';
import { FirstName } from './App'; // FirstName ko curly bracket me lika hai kyuki hamne FirstName ko as a default export nahi kiya hai.

const ComC = () => {
  return (
    <>
      <FirstName.Consumer>
        {(value) => {
          return <h1>My Name is {value}</h1>;
        }}
      </FirstName.Consumer>
      ;
    </>
  );
};
export default ComC;

